import vue from "vue";
import App from "./App.vue";
import router from "./router";
import store from "./store";
import "bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";
import "./scss/main.scss";
import "normalize.css";

vue.config.productionTip = false;

new vue({
    router,
    store,
    render: h=>h(App)
}).$mount("#app");
